INSERT INTO catalogue_product
VALUES ('1042', '12 mini-cônes', 'Mini-cône vanille:
Crème glacée à la vanille 57,3%: lait écrémé réhydraté 68,2%, sucre, beurre, sirop de glucose-fructose de blé et de maïs, glucose de pomme de terre et de maïs en poudre, émulsifiant: mono- et diglycérides d,acides gras, stabilisants (farine de graines de caroube, gomme de guar), arôme naturel de vanille 0,1%.
Gaufrette 22,5%: farine de blé, sucre, graisse de palme, eau, émulsifiant: lécithine de soja, sel, sirop de caramel.
